import dynamic from "next/dynamic"

const Rust = dynamic({
  loader: async () => {
    const rust = await import('../pkg/tic_tac_toe.js')

    return (
      (props) => {
        return (
          <>
            <div>{rust.num()}</div>
            <div>{rust.greet("nacho")}</div>
          </>
        )
      })
  },
})

export default Rust
